import numpy as np
from scipy.special import hyp1f1


def boys(n, t): 
    return hyp1f1(n + 0.5, n + 1.5, -t) / (2.0 * n + 1.0)


def g_ijkl(ii, jj, kk, ll, mm, nn, oo, pp, qq, rr, ss, tt, 
           alpha, beta, gamma, delta, A, B, C, D):
    p = alpha + beta
    q = gamma + delta
    rho = p * q / (p + q)
    AB = A - B
    CD = C - D
    r_AB = np.dot(AB, AB)
    r_CD = np.dot(CD, CD)
    P = (alpha * A + beta * B) / p
    Q = (gamma * C + delta * D) / q
    PQ = P - Q
    pRPQ = rho * np.dot(PQ, PQ)
